import styled, {css} from 'styled-components';
import React, { Component } from 'react';

const DeleteQuestionText = styled.div`
		position: absolute;
		padding: 5px 10px;
		left: calc(50% + 20px );
		top: -30px;
		color: white;
		font-size: 14px;
		background-color: rgba(79, 157, 166, 0.7);
		border-radius: 4px;
		
`; 
const Trinagle = styled.div`
		position: absolute;
		left: calc(50% -15px);
		bottom: -10px;
		width: 0;
		height: 0;
		border-left: 30px solid transparent;
		border-right: 30px solid transparent;
		border-top: 30px solid rgba(79, 157, 166, 0.2);
`;

export default function questionDeleteFlag (props) {
    return (
		<DeleteQuestionText >
				<Trinagle ></Trinagle> 
				  Delete question 
		</DeleteQuestionText >
	)
}
